import React, { Component } from 'react';
import { Header } from 'semantic-ui-react'

class NotFound extends Component {
    render() {
        return (
            <div>
                <Header className="not-found-header">Seems like you go lost out there.</Header>
                <Image />
            </div>
        );
    }
}

export default NotFound;
